ctice their vocals and dance moves than study chemistry or history. Some even ditch their classes or, even worse, the whole day in school to audition in an entertainment because of the conflict in schedules. Although being able to be an idol is a great achievement, people should still remember to go to school and study hard because education to the younger generations is also important in a countryâs growth and improvement and it serves as building blocks for their future.\nIt is sad to see that many stars who are in high school and are born on or after 1994, decides to give up college education to pursue their goals despite that they can go through a special screening to get into college because of their position. IU, 2NE1âs Min, f(x)âs Sulli, So Hyun, Ji Yeon and many more decided to focus on their career to fully improve themselves and be trained to be a well-rounded idol who can sing, dance, act and many more. Although, there are still some idols such as Eun Jung from a girl-group, T-ara, Yoona from Girlâs Generation and G-Dragon decided to enroll in college. They chose to be majored in arts because the course could improve their skills that is related to their current idol career like singing and acting which is certainly a better decision than not enrolling in anything at all. There are also some Korean celebrities who chose to major in something unrelated to their idol career, Lee Seung Gi, a well-known actor, singer and MC majored in international Trade and Commerce at Dongguk University, Taecyeon, a beastly idol from 2PM, majored in business administration at Dankook University, and other idols such as Rain, Ha Ji-Won and Heechul. Leaving their studies is not the best choice that idols have because, as we all know, their idol status will eventually fade. If they continue to study until they graduate college and get a degree, this would be easier for them to open a new path or career in the future.\nEducation is really important and due to the advance technology, people can attend college anywhere they are. Online Universities which provide students accredited bachelorsâ and masterâs degree for their offered courses are available throughout South Korea. Korea National Open University, Daegu Cyber University and Seoul Cyber University are three of the many online universities in South Korea which provides distance learning programs but education is not the problem. The Idolâs willingness to study and learn new things is what will keep them going. Even if they enroll in the best university that suites their busy schedules, if they donât want to learn then everything is just a waste of time and a waste of effort.\n Idolâs willingness to learn and be successful is the baseline to pursue both their goals and at the same time be able to attend school. If they are willing to attend school and train despite their hectic schedules, they will arrive at where they want to be. Giving up college just to focus on their career wonât help improve the countryâs growth and may lead to difficulties in life when their idol career is over. Just like Rain and Lee Seung Gi, idols should also concentrate on their academics to build a better foundation for themselves.\n\nREFERENCES:\nKim,Yonghee. âRedefining the Real Korean Waveâ. LIST Magazine. Retrieved on January 25, 2014 from <http://www.list.or.kr/articles/article_view.htm?Div1=8&Idx=790>\nWilliamson, Lucy. âThe Dark Side of South Korean Pop Musicâ. BBC News Seoul. Retrieved from January 25, 2014 from  <http://www.bbc.co.uk/news/world-asia-pacific-13760064 >\nâA Korean Idolâs Life: Sweat and Sleepless Nightsâ.Joongangdaily. Retrieved from March 30,2014 from <http://www.asianbite.com/post/A-Korean-Idol\'s-Life:-Sweat-and-Sleepless-Nights-news-3226>\nAMRA. âKpop Idol Stars Graduating High School This Yearâ. Fashion Times. Retrieved from March 30, 2014 from <http://www.fashiontimes.com/articles/2473/20140209/kpop-idol-stars-graduating-high-school-year.htm>\nhttps://www.youtube.com/watch?v=V80ZFb1mkPA\nâK-pop Idols Are Livinâ The College Life(Kinda)â.Seoul Beats. Retrieved from March 30, 2014 from < http://seoulbeats.com/2012/04/k-pop-idols-are-livin-the-college-life-kinda/>','10201776016104322','Glendora Tiu',NULL,NULL,NULL,'2014','04','10'),(2838,'ë¯¸ì¹ê² ì´!!! ì¿¤íë ë­ì¼?!  í!\nëë¬´ ëë¬´ ì«ì´!!!','10201756519176911','',NULL,NULL,NULL,'2014','04','06'),(2839,'payag b tayo dito Hottest? SONEs? \n#byeKhuntoria cant support khun on this one.... :\'((( \nplease... you kept this relationship for 4 years?! really? hayyy!!!!\n\n#nosupport sorry khun','10201756354852803','',NULL,NULL,NULL,'2014','04','06'),(2840,'http://www.facebook.com/l.php?u=http%3A%2F%2Fwww.allkpop.com%2Farticle%2F2014%2F04%2Fgirls-generations-tiffany-and-2pms-nichkhun-go-public-with-their-relationship-of-4-months&h=gAQHII6PQ\n\ndepressing, really.... \ni like her, i like him but i dont think i like both of them together...\nassdfhgaldkfijfdl','10201746633969787','',NULL,NULL,NULL,'2014','04','06'),(2841,'Sakit na ulo namin -.- \'\n\nCRAM * (DASALGO MP + OBJECP MP) = DISASTER','10201738402444004','Robee Khyra Te, Raisa Gennel Lee, Angeline J. Tan, Janine Tan, Bianca Regala and Olivia Marasigan',NULL,NULL,NULL,'2014','04','03'),(2842,'VITA 500 Angeline J. Tan','10201732129447183','',NULL,NULL,NULL,'2014','04','01'),(2843,'proud of Raisaaaa!!! sleeveless na! skirt pa!!! big change <3 still cute ^^ \nShailaaaa rinn so cuteeeeee!!! d rin sanay magskirt haha ^^','10201709207794156','Robee Khyra Te, Shaila Mae Choa, Raisa Gennel Lee, Angeline J. Tan, Janine Tan, Bianca Regala, Walchester Gaw, Olivia Marasigan, Shayane E. Tan, Austin Fernandez and Seaver Choy',NULL,NULL,NULL,'2014','03','29'),(2844,'sino toh? sino toh ? RUBBY!!! Raisa Gennel Lee Janine Bianca Regala Angeline Tan Janine Tan Patricia Lim','10201702496786385','',NULL,NULL,NULL,'2014','03','27'),(2845,'I\'m a squishy angel','10201694974278327','',NULL,NULL,NULL,'2014','03